//   int xx,yy;
//   for(xx=0;xx<ncisbasis;xx++){
//     for(yy=0;yy<ncisbasis;yy++){
//       Hamiltonian(xx,yy)=H_f_qchem[xx+yy*ncisbasis];
//       Hamiltonian_1e(xx,yy)=H_1e_f_qchem[xx+yy*ncisbasis];
//       Hamiltonian_2e_j(xx,yy)=H_2e_j_f_qchem[xx+yy*ncisbasis];
//       Hamiltonian_2e_xc(xx,yy)=H_2e_xc_f_qchem[xx+yy*ncisbasis];
//     }
